				<h1 class="shead-style text-center">TAMIL NADU</h1>
				<p>A land of temples , a land of ancient culture and a land of history Tamil nadu is a jewel in the south. Literally the land of Tamils , it is the largest tamil speaking region in the world. A sacred land for Hindus it houses some of the most beautiful and architecturally significant temples. Also having The western ghats on the western side it definitely  has a diverse landscape. Famous for delicious south Indian foods and coconuts Tamil nadu is one of the most popular destinations in India.<br><br>
        A place very religious and diverse it has some of the unique sculptures, statues, forts, temples and churches. A place always welcomed for the visitors and very hospitable this place is definitely everyones autumn retreat.

